import React from 'react'
import { Link as LinkS } from 'react-scroll'

const Button = () => {
    return (
        <button className="smallButton"
            style={{
            backgroundColor: '#ffffff',
            color:'#000000',
            padding: '12px 30px'
            }}>
            <LinkS >
                Get Started
            </LinkS>
        </button>       
    )
}

export default Button
